import React from 'react';
import '/home/moglix/Desktop/projectFrontend/my/src/Components/EmployeeComponent/EmployeeComponent.css';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';
class Employee extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            employee:[]
        }
      }
      componentDidMount()
      {
        fetch('https://mocki.io/v1/8b58f489-d1d2-4b4c-b2bd-02c0603c8112')
        .then(response => response.json())
        .then(result => {
            let tmpArray = []
            for (var i = 0; i < result.data.length; i++) {
                tmpArray.push(result.data[i])
            }
            this.setState({employee:tmpArray})
        })
        .catch(e => {
            console.log(e);
        });

      }
    render(){
       console.log(this.state.employee);

        return(
        <div>
            {/*----------------------Navbar----------------- */}

            <nav className="navbar navbar-expand-sm navbar-light bg-light">
            <a className="navbar-brand" href="https://www.moglix.com/" >
                <img src="https://cdn.moglix.com/assets/img/moglix-logo.jpg" id="logo"/></a>
            <ul className="navbar-nav">
                <li className="nav-item">
                    <a className="nav-link" href="#">
                      <h5>Dashboard</h5></a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="#" style={{paddingLeft:"2"}}><h5>About</h5></a>
                </li>
            </ul>
        </nav><br />
         {/*----------------------Navbar Ends----------------- */}

         {/*---------------- Side Bar------------------- */}
        <div className="container-fluid">
            <div className="row">
                <div className="col-md-2">
                    <div className="card" id="mc">
                        <div className="card-body" id="maincard">
                        </div>
                    </div>
               </div>

        {/*----------Main Content------------------------ */}
                <div className="col-md-10 ">
                    <div className="card">
                        <div className="card-body">
                        <button type="button" class="btn btn-primary" data-toggle="modal" data-target="#exampleModalCenter">
  Launch demo modal
</button>
<div class="modal fade" id="exampleModalCenter" tabindex="-1" role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
  <div class="modal-dialog modal-dialog-centered" role="document">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="exampleModalLongTitle">Modal title</h5>
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div class="modal-body">
        ...
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
        <button type="button" class="btn btn-primary">Save changes</button>
      </div>
    </div>
  </div>
</div>

</div>
</div>
               <div>
               <ul className="list-group">
               {this.state.employee.map((emp)=>(
                 <li>{emp.id}</li>
               )

               )}
               </ul>
                </div>

                <div className="card" id="mc">
                        <div className="card-body" id="maincard">
                        </div>
                        </div>
                </div>








            </div>
        </div>

















        </div>
            );
    }
}
export default Employee;
